(200021, 3, '2013-06-28 06:48:20', 100003, '2013-07-12 12:08:07', 'Closed', 900001, 100003, '2013-06-28 06:48:20', NULL, NULL, 100003, '2013-07-12 16:08:07', '0.0', '1.0', 'Critical', 'Products', 'Marcelo - definir com Juliana sobre codigo dos produtos, solicitacao feita ontem por equipe de vendas', 'Pat, a princípio, iniciaremos o sistema sem código, e depois num futuro (versao 2.0) pensaremos num sistema de códigos que permita a identificacao da familia do produto.\nExemplo:\n5001001 Moleton Comum\n5011001 Moleton Felpado\n5011002 Moleton Felpado Peach Skin\n5021001 Moleton Botone', NULL),
