(200024, 3, '2013-07-15 07:46:26', 100001, '2013-07-16 20:42:57', 'Closed', 900001, 100003, '2013-07-15 07:46:26', NULL, NULL, 100001, '2013-07-17 00:42:57', '0.0', '2.0', 'Major', 'FTPs', 'Colocar data e coleçao na impressao de FTPs (Pode ser na mesma linha de onde vai escrito DL Malhas. Deixar em negrito a informação da Pergunta Falha? o Com ou o Sem deve estar em negrito também.\nA impressão da FTP deve ser feita para caber em apenas uma página, se tivermos uma FTP maior as margens podem ser diminuidas e o tamanho da fonte automaticamente para caber em uma só página?', '', 'print.jpg,2013-07-15 11:46:53,670045'),
(200025, 3, '2013-07-15 07:50:07', 100001, '2013-07-16 17:56:39', 'Closed', 900001, 100003, '2013-07-15 07:50:07', NULL, NULL, 100001, '2013-07-16 21:56:39', '0.0', '0.2', 'Minor', 'Products', 'No cadastro de produtos, a primeira busca esta por tubular, colocar como all, para trazer todos os produtos por favor.', 'products.js, select = Tubular to All', NULL),
(200026, 3, '2013-07-19 18:20:45', 100001, '2013-07-20 07:47:22', 'Closed', 900001, 100003, '2013-07-19 18:20:45', NULL, NULL, 100001, '2013-07-20 11:47:22', '0.0', '1.0', 'Major', 'FTPs', 'Pat, por gentileza, abrir na ftp mais um campo para up load de xml ou pdf para carregamento de dedos de fio nas máquinas. Não fale a pena inserirmos na ftp arquivos para isso pois podem chegar a 200 linhas de preenchimento e são apenas para tecidos listrados.', 'added extension: pdf and xlm to upload drawing', NULL),
(200027, 3, '2013-08-01 06:16:35', 100001, '2013-08-01 18:39:07', 'Closed', 900001, 100003, '2013-08-01 06:16:35', NULL, NULL, 100001, '2013-08-01 22:39:07', '0.0', '2.0', 'Major', 'FTPs', 'Pat, por favor abrir um quarto campo para carregamento de fio na ftp (recue os outros para a esquerda, minha sugestão) e, quando os fios nao forem preenchidos em algum dos campos, inibir ele na impressao da ficha.', '', 'solicitacao.jpg,2013-08-01 10:16:57,332453'),
(200028, 3, '2013-08-03 06:04:49', 100001, '2013-08-03 09:47:53', 'Closed', 900001, 100003, '2013-08-03 06:04:49', NULL, NULL, 100001, '2013-08-03 13:47:53', '0.0', '1.0', 'Major', 'Contacts', 'Nao estou conseguindo criar novos contatos nem alterar os existentes.', 'Ja esta consertado e ja cadastrei Bruno tambem.', '03_08.jpg,2013-08-03 10:05:09,361963'),
