(200030, 3, '2013-08-14 16:34:20', 100001, '2013-08-15 10:20:56', 'Closed', 900001, 100003, '2013-08-14 16:34:20', NULL, NULL, 100001, '2013-08-15 14:20:56', '0.0', '1.0', 'Normal', 'FTPs', 'Pat, as buscas em FTP nao estao funcionando em nenhum filtro: nome, numero da ftp, composiçao, máquina, em todas elas temos esse retorno do sql.', 'drop out old fields [lanes, elasticity, needling]', 'erro.jpg,2013-08-14 20:34:38,293021'),
(200031, 3, '2013-08-14 16:35:32', 100001, '2013-09-11 10:21:27', 'Open', 900001, 100003, '2013-08-14 16:35:32', NULL, NULL, NULL, NULL, '0.0', '0.0', 'Version 2', 'Permissions', 'Pat - Preciso criar dois usuários que só podem visualizar as FTP, nem imprimir não pode, tem como fazermos isso?', '', NULL),
(200032, 3, '2013-08-14 16:37:20', 100001, '2013-09-11 09:28:24', 'Closed', 900001, 100003, '2013-08-14 16:37:20', NULL, NULL, 100001, '2013-09-11 13:28:24', '0.0', '4.0', 'Critical', 'FTPs', 'Para agilizar o trabalho em FTP, seria interessante poder clicar numa FTP e duplicar ela, pois muitas vezes só muda o nome da máquina, assim não precisa realizar todas as digitaçoes novamente.', '', NULL),
