(200034, 3, '2013-08-14 16:47:27', 100001, '2013-09-11 09:27:54', 'Closed', 900001, 100003, '2013-08-14 16:47:27', NULL, NULL, 100001, '2013-09-11 13:27:54', '0.0', '0.3', 'Minor', 'History', 'Por favor, limpar todo o banco de dados nos caso de compras, entradas e saidas de estoque para iniciar novos testes. A etiqueta de caixas esta 100% aprovada.', 'Foi limpo por Pat, agora 14/08 as 22:39', NULL),
