(200036, 3, '2013-08-14 17:17:19', 100001, '2013-09-11 09:27:15', 'Closed', 900001, 100003, '2013-08-14 17:17:19', NULL, NULL, 100001, '2013-09-11 13:27:15', '0.0', '0.3', 'Minor', 'General', 'Pat, como segue na imagem, nas buscas, acabam retornando pouco produtos, se tivermos como mostrar uma gama maior de produtos, mesmo que seja em mais páginas, vai facilitar a busca. Veja que tenho mais produtos OE do que o que a busca me retornou, isso me obriga a digitar o nome praticamente completo do produto.', 'RESOLVIDO HOJE, 14/08, AS 22:40 POR PAT ENSINANDO A USAR O % PARA BUSCA', 'busca.jpg,2013-08-14 21:17:51,250656'),
