(200051, 3, '2013-09-21 05:47:03', 100001, '2013-09-21 06:53:27', 'Closed', 900001, 100003, '2013-09-21 05:47:03', NULL, NULL, 100001, '2013-09-21 10:53:27', '0.0', '1.0', 'Major', 'FTPs', 'NA FUNCAO DE COPIA, OS CAMPOS EM BRANCO FICAM PRENCHIDOS COMO NULL, CONFORME IMAGEM.', 'if (my_row.value) {\n...\n}', 'Erro_21-09_03.jpg,2013-09-21  9:47:24,187193'),
